/**
 * @param {string} haystack
 * @param {string} needle
 * @return {number}
 */
var strStr = function (haystack, needle) {
    if (!needle) return 0
    for (i = 0; i < haystack.length; i++) {
        for (j = 0; j < needle.length; j++) {
            if (haystack[i + j] !== needle[j])
                break
            if (j === needle.length - 1)
                return i
        }

    }
    return -1
};

console.log(strStr('asdf', ''))
console.log(strStr('david', 'vie'))
console.log(strStr('david', 'vid'))

console.log(strStr("",""))
